import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';

const people = [
  { name: 'Arto Hellas' }
] 

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App people={people} />
  </React.StrictMode>
);
